import React from "react";

const Header = ({ user }) => {
  return (
    <div className="header">
      <div className="grid">
        <div className="start">
          <a href="/">Home</a>
        </div>
        <div className="end">
          {nickname ? (
            <span className="nickname">
              <i className="far fa-user"></i>
              {user.nickname}
            </span>
          ) : (
            <React.Fragment>
              <a href="/">Login</a>
              <a href="/">Register</a>
            </React.Fragment>
          )}
        </div>
      </div>
    </div>
  );
};

export default Header;
